import './App.css';
import Formulario from './pages/Login.js';

function App() {
  return (
    <div className="App-header">
      <Router>
        <Formulario>
          <Route path="./pages/EntrarCaixa" component={EntraCaixa}/>
        </Formulario>
      </Router>

    </div>
  );
}

export default App;
